def analyze_data_smoothing(msmt_results, protocol, clt_bytes):

    # TODO: Sloppy
    data_pts = msmt_results

    # x axis is time, y axis is ratio
    x_axis_conn1 = []
    x_axis_conn2 = []
    y_axis_conn1 = []
    y_axis_conn2 = []

    for data in data_pts:
        # ok endtimestamps
        end_conn1 = data[0]['ts-end']
        end_conn2 = data[1]['ts-end']
        start_conn1 = data[0]['ts-start']
        start_conn2 = data[1]['ts-start']
        byte_conn1 = data[0]['bytes']
        byte_conn2 = data[1]['bytes']

        time_end_conn1 = datetime.datetime.strptime(
            end_conn1, '%Y-%m-%dT%H:%M:%S.%f')
        time_start_conn1 = datetime.datetime.strptime(
            start_conn1, '%Y-%m-%dT%H:%M:%S.%f')

        time_end_conn2 = datetime.datetime.strptime(
            end_conn2, '%Y-%m-%dT%H:%M:%S.%f')
        time_start_conn2 = datetime.datetime.strptime(
            start_conn2, '%Y-%m-%dT%H:%M:%S.%f')

        measurement_length_conn1 = (
            time_end_conn1 - time_start_conn1).total_seconds()
        measurement_length_conn2 = (
            time_end_conn2 - time_start_conn2).total_seconds()

        # ensure timestamps are not identical: would result in msmt_length = 0 => division by zero
        # this does not prevent multiple timestamps resulting same msmt_length
        if measurement_length_conn1 > 0.0:
            bw_conn1 = ((int(byte_conn1) * 8) / 10**3) / \
                measurement_length_conn1
            # debug print("bw conn1 are: ", bw_conn1)
            y_axis_conn1.append(int(bw_conn1))
            x_axis_conn1.append(int(round(measurement_length_conn1)))

        if measurement_length_conn2 > 0.0:
            bw_conn2 = ((int(byte_conn2) * 8) / 10**3) / \
                measurement_length_conn2
            # debug print("bw conn2 are: ", bw_conn2)
            y_axis_conn2.append(int(bw_conn2))
            x_axis_conn2.append(int(round(measurement_length_conn2)))

    iteration_result = []
    iteration_xaxis_result = []
    iteration_yaxis_result = []
    iteration_xaxis_result.append(x_axis_conn1)
    iteration_xaxis_result.append(x_axis_conn2)
    iteration_yaxis_result.append(y_axis_conn1)
    iteration_yaxis_result.append(y_axis_conn2)
    iteration_result.append(iteration_xaxis_result)
    iteration_result.append(iteration_yaxis_result)
    # debug print("\n\niteration result: ", iteration_result)
    return iteration_result

