def plot_data_smoothing(gp_avg, rate, iteration):

    ### no smoothing ###
    x_axis_conn1 = gp_avg[0][0]
    x_axis_conn2 = gp_avg[0][1]

    y_axis_conn1_normalized = gp_avg[1][0]

    y_axis_conn2_normalized = gp_avg[1][1]

    # debug

    xticks_list = []

    last_x_conn1 = x_axis_conn1[-1]
    last_x_conn2 = x_axis_conn2[-1]

    if last_x_conn1 >= last_x_conn2:
        last_x = last_x_conn1
    else:
        last_x = last_x_conn2

    current_x = 0
    xticks_list.append(current_x)

    while current_x < last_x:
        current_x = current_x + 20
        xticks_list.append(current_x)

    # first plot
    fig = plt.figure(figsize=(11, 9))
    # debug ay1 = plt.subplot(411)
